Layer.Datasource:

  (select way, clade,sci_name,zoomview,ref, nbdesc
  from polygons
  where ref=1
  order by nbdesc DESC
) as RES
&datasource-settings;


  (select way,clade,sci_name,zoomview,ref, nbdesc
  from polygons
  where ref=2
  order by nbdesc DESC
) as RES
&datasource-settings;


  (select way,clade,sci_name,zoomview,ref, nbdesc
  from polygons
  where ref=3
  order by nbdesc DESC
) as RES
&datasource-settings;


  (select way,branch,zoomview, ref
  from lines
  where branch is true
  ) as roads

&datasource-settings;


  (select way,sci_name, zoomview, nbdesc
  from points
  where sci_name='Root'
) as placenames
&datasource-settings;


  (select way,cladecenter,zoomview,sci_name, common_name, nbdesc
  from points
  where cladecenter is true
  order by nbdesc DESC
) as placenames
&datasource-settings;


  (select way,tip,zoomview,sci_name,common_name, nbdesc
  from points
  where cladecenter is null and tip is false
  order by nbdesc DESC
) as points
&datasource-settings;


  (select way,sci_name,common_name,tip,zoomview, nbdesc
  from points where tip is true
) as placenames
&datasource-settings;


  (select way, branch,zoomview, name
  from lines
  where branch is true          
  ) as roads

&datasource-settings;


  (select way, rankname,rank, zoomview,ref
  from lines
  where rankname is true and ref=1           
  ) as roads

&datasource-settings;


  (select way, rankname,rank,zoomview,ref
  from lines
  where rankname is true and ref=2          
  ) as roads

&datasource-settings;


  (select way, rankname,rank,zoomview,ref
  from lines
  where rankname is true and ref=3
  ) as roads

&datasource-settings;
